CREATE FUNCTION eq.decode(v numeric, VARIADIC arr numeric[]) RETURNS numeric
    LANGUAGE sql IMMUTABLE
    AS $$
with t as (select * from unnest(array(select generate_series(1,array_length(arr, 1))), arr) t(a,b))
select COALESCE(t2.b,t1.b) from t as t1
left join t as t2 on t1.a = t2.a - 1
where t1.a%2=1 and (t1.b = v or t2.b is null)
order by t2.b nulls last;
$$;


