CREATE PROCEDURE eq.eq_oprimaze(in_task_id integer)
    LANGUAGE plpgsql
    AS $$
declare 
  v_x_num integer;
begin
  update eq_xs set
    val = null
  where id_task = in_task_id;

  loop
  
  call eq_set_x_min_max(in_task_id);

  select id 
  into v_x_num
  from eq_xs x 
  where x.val is null and x.id_task = in_task_id 
  order by x.k * x.limit_max desc limit 1;
  EXIT WHEN v_x_num is null;  
  update eq_xs set val = limit_min where id = v_x_num;
  --commit;
  end loop;
  
end
$$;


